import "./mailList.css";
const MailList = () => {
  return (
    <div className="mail">
      <h1 className="mailTitle">mail list</h1>
      <span className="mailDesc">sign up to get informed about fests</span>
      <div className="mailInputContainer">
        <input type="text" placeholder="Your Email" />
      </div>
    </div>
  );
};

export default MailList;
